import Jumbotron from './jumbotron/Jumbotron';

class Nosotros extends React.Component {

	render() {

		return(
			<>
			<main role="main" className="flex-shrink-0 mt-5">
				<Jumbotron />
	  		</main>
	  		</>

		)

	}

}

export default Nosotros;
